import { Link, useParams } from "react-router-dom";

const EventsDetailPage = () => {
  const params = useParams();
  return (
    <>
      <h1>Events Detail Page</h1>
      <p>{params.eventId}</p>
      <p>
        <Link to=".." relative="path">
          Go Back
        </Link>
      </p>
    </>
  );
};

export default EventsDetailPage;
